B.N4=A.a(s(["Die blaue Kurve entspricht der Kennlinie des Transistors T2 des Stromspiegels.","Im aktiven Vorw\xe4rtsbetrieb, d.h. f\xfcr UBC > 0V, verl\xe4uft die Kennlinie sehr flach, so dass der Strom Io n\xe4herungsweise konstant ist.","Nimmt die Spannung Uo am Ausgang des Stromspiegels zu, vermindert sich die Spannung UBC, bis der Basis-Kollektor-\xdcbergang des Transistors T2 schlie\xdflich f\xfcr UBC < 0V in Durchlassrichtung gepolt wird. Der Transistor T2 geht dann in S\xe4ttigung und der Strom Io nimmt ab.Sind beide Transistoren gleich gro\xdf, d.h., ist IS1 = IS2, so entspricht der Strom Io im aktiven Vorw\xe4rtsbetrieb etwa dem Strom Iref durch den Referenztransistor T1.","Das Stromverh\xe4ltnis Io zu Iref kann \xfcber das Verh\xe4ltnis IS1 zu IS2 eingestellt werden, so dass sich mit dem Stromspiegel beliebige Str\xf6me generieren lassen.","Die Steigung der Kennlinie des Transistors T2 h\xe4ngt von dem Ausgangswiderstand r0 des Transistors und damit von der Early-Spannung Uan ab. Je gr\xf6\xdfer die Early-Spannung Uan ist, um so flacher verl\xe4uft die Kennlinie, d.h. um so weniger h\xe4ngt der eingestellte Strom Io von der Spannung Uo ab."]),t.i)
